import React from "react";
import "./styles.css"; // Make sure this path is correct

function Home() {
  return (
    <div className="home-container">
      <h1>Welcome to BMW Cars</h1>
      <img
        src={`${process.env.PUBLIC_URL}/54e21663-f198-4c7f-8379-98444080342f.webp`}
        alt="BMW 5 Series"
      />
      {/* Assuming you have a navigation or routing setup to go to login */}
      <button className="login-button">Login</button>
    </div>
  );
}

export default Home;
